import React from "react";

const MovieCard = ({ movie } = props) => {
  return (
    <div className='movie'>
      <div>
        <p>{movie.year}</p>
      </div>
      <div>
        <img src={movie.image == "N/A" ? "" : movie.image} />
      </div>
      <div>
        <span>{movie.type}</span>
        <h3>{movie.title}</h3>
      </div>
    </div>
  );
};

export default MovieCard;
